import React from "react";
import { Card, Image } from "react-bootstrap";

function Profile() {
  const user = {
    fullName: "John Doe",
    email: "john@example.com",
    joinDate: "2025-08-20",
    profilePic: require("../assets/profile.jpg"),
  };

  return (
    <Card style={{ marginLeft: "240px", padding: "20px", maxWidth: "500px" }}>
      <div style={{ display: "flex", alignItems: "center", gap: "20px" }}>
        <Image src={user.profilePic} roundedCircle width={80} height={80} />
        <div>
          <h3>{user.fullName}</h3>
          <p>{user.email}</p>
          <p>Date Joined: {user.joinDate}</p>
        </div>
      </div>
    </Card>
  );
}

export default Profile;
